import React from 'react';
import bivakzones from '../bivakzones.json';



var data = [
    { bivakzones }
];

class WcList extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            data: data
        }
    }

    render() {
        return (
            <div>
                <h1>Heading</h1>
                {bivakzones}
                <div>{this.state.data.map(item => (
                    <li>{item.product}</li>
                ))}
                </div>
            </div>
        );
    }
};

export default WcList;
